import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import '../styles/ModernNavbar.css';

const ModernNavbar = () => {
  const [scrolled, setScrolled] = useState(false);
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);
  const [activeLink, setActiveLink] = useState('home');

  // Handle scroll effect for navbar
  useEffect(() => {
    const handleScroll = () => {
      setScrolled(window.scrollY > 50);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  // Toggle mobile menu
  const toggleMobileMenu = () => {
    setMobileMenuOpen(!mobileMenuOpen);
    // Prevent body scrolling when menu is open
    document.body.style.overflow = mobileMenuOpen ? 'auto' : 'hidden';
  };

  // Set active link
  const handleSetActive = (linkName) => {
    setActiveLink(linkName);
    setMobileMenuOpen(false);
    document.body.style.overflow = 'auto';
  };

  return (
    <header className={`modern-header ${scrolled ? 'scrolled' : ''}`}>
      <div className="header-bg">
        <div className="bg-highlight"></div>
      </div>

      <div className="container">
        <nav className="modern-navbar">
          {/* Logo with animation */}
          <Link to="/" className="modern-logo" onClick={() => handleSetActive('home')}>
            <div className="logo-wrapper">
              <span className="logo-text">Seraune</span>
              <span className="logo-dot"></span>
            </div>
          </Link>

          {/* Main Navigation */}
          <div className={`nav-links-container ${mobileMenuOpen ? 'open' : ''}`}>
            <div className="menu-backdrop"></div>
            <ul className="nav-links">
              <li className="nav-item">
                <Link 
                  to="/" 
                  className={`nav-link ${activeLink === 'home' ? 'active' : ''}`}
                  onClick={() => handleSetActive('home')}
                >
                  <span className="nav-text">Home</span>
                </Link>
              </li>
              <li className="nav-item">
                <Link 
                  to="/services" 
                  className={`nav-link ${activeLink === 'services' ? 'active' : ''}`}
                  onClick={() => handleSetActive('services')}
                >
                  <span className="nav-text">Services</span>
                </Link>
              </li>
              <li className="nav-item">
                <Link 
                  to="/about" 
                  className={`nav-link ${activeLink === 'about' ? 'active' : ''}`}
                  onClick={() => handleSetActive('about')}
                >
                  <span className="nav-text">About</span>
                </Link>
              </li>
              <li className="nav-item">
                <Link 
                  to="/portfolio" 
                  className={`nav-link ${activeLink === 'portfolio' ? 'active' : ''}`}
                  onClick={() => handleSetActive('portfolio')}
                >
                  <span className="nav-text">Portfolio</span>
                </Link>
              </li>
              <li className="nav-item">
                <Link 
                  to="/blog" 
                  className={`nav-link ${activeLink === 'blog' ? 'active' : ''}`}
                  onClick={() => handleSetActive('blog')}
                >
                  <span className="nav-text">Blog</span>
                </Link>
              </li>
            </ul>
          </div>

          {/* Right Section with CTA Button */}
          <div className="nav-right">
            <Link 
              to="/contact" 
              className="cta-button"
              onClick={() => handleSetActive('contact')}
            >
              <span>Contact Us</span>
              <div className="button-backdrop"></div>
            </Link>

            {/* Animated Hamburger Button */}
            <button 
              className={`menu-toggle ${mobileMenuOpen ? 'active' : ''}`} 
              onClick={toggleMobileMenu}
              aria-label="Toggle menu"
            >
              <div className="menu-icon">
                <span></span>
                <span></span>
                <span></span>
              </div>
            </button>
          </div>
        </nav>
      </div>
    </header>
  );
};

export default ModernNavbar;
